const prepNames = people.map((person) => {
    const {first_name , last_name} = person
    return {first_name: first_name.toLowerCase() , last_name: last_name.toLowerCase()}
  }).sort((a, b) => {
    if (a.last_name > b.last_name) return 1;
    if (a.last_name === b.last_name) {
      if (a.first_name > b.first_name) return 1;
      return -1
    }
    return -1;
  });
  
export default prepNames;